import './projects.css';

const Projects = () => {
    return(
        <div className="project__container">
<div className="project__title">
        <h1>Some Projects We've Worked On</h1>
 </div>

        <div className="project__cards">
            <div className="card one">Project</div>
            <div className="card two">Project</div>
            <div className="card three">Project</div>
            <div className="card four">Project</div>
            <div className="card five">Project</div>
            <div className="card six">Project</div>
        </div>

        </div>  
    ) 
}

export default Projects
